  `info` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注信息',
  `status` int(1) NULL DEFAULT 0 COMMENT '状态【预约中0/已到店1/用户取消2/超时取消3/已结算4/已支付5】',
